  window._galleryUpdate = function () {

    var $galleryThumbs = $('.js-gallery-thumbs');
    var $galleryMain = $('.js-product-gallery-main');
    var $galleryTriggers = $galleryThumbs.find('.js-gallery-trigger');

    if ($galleryThumbs.length) {

      $galleryThumbs.swiper({
        spaceBetween: 10,
        initialSlide: 0,
        centeredSlides: false,
        slidesPerView: 4,
        touchRatio: 0.2,
        slideToClickedSlide: true,
        direction: 'vertical',
        loop: false
      });

      $galleryMain.swiper({
        spaceBetween: 10,
        effect: 'slide',
        nextButton: '.js-gallery-thumbs-next',
        prevButton: '.js-gallery-thumbs-prev',
        loop: false,
        centeredSlides: true,
        initialSlide: 0,
        touchRatio: 0.2,
        onSlideChangeEnd: function (e) {
          $galleryTriggers.not(':eq(' + e.activeIndex + ')').removeClass('active');
          $galleryTriggers.eq(e.activeIndex).addClass('active');
          $galleryThumbs[0].swiper.slideTo(e.activeIndex);
        }
      });

      $galleryTriggers.on('click', function (e) {
        e.preventDefault();
        var index = $(this).index();
        if (!$(this).hasClass('active')) {
          $(this).addClass('active');
        }
        $(this).parent('.swiper-wrapper').find('.swiper-slide').not($(this)).removeClass('active');
        $galleryMain[0].swiper.slideTo(index);
      });

    }

    //$('.product-gallery').animate({opacity: 1}, 300)
  };

  $(document).ready(function() {
    _galleryUpdate()
  });


