function checkExternalDelivery(url, id, country, region, city){
	$.ajax({
		type: 'GET',
		url: url,
		cache: false,
		data: 'region='+region+'&city='+city+'&weight='+geoTotalWeight+'&price='+geoItemsPrice,
		dataType: 'jsonp',
		success: function(e){
			if(e.error != undefined && e.delivery_price == false){
				$('.js-geo-item-'+id).parents('.delivery_info-line').hide();
			}else{
				$('.js-geo-item-'+id).parents('.delivery_info-line').show();
				$('.js-geo-item-'+id).html('').html((parseInt(e.delivery_price) == 0)?'':Shop.money.format(e.delivery_price));
				if(e.error != undefined){
                  console.log(1)
					$term = e.error.replace(/[^-0-9]/gim,'');
					$item = $term.split('-');
					if($item.length > 0){
						$('.js-geo-item-'+id).prepend($term+' '+declOfNum($item[$item.length-1],[" "," "," "])+', ');
					}else{
                    	$terms = checkTerms(id);
                      	$('.js-geo-item-'+id).prepend($terms+', ');
                    }
				}else{
                  console.log(2)
                  $terms = checkTerms(id);
                  $('.js-geo-item-'+id).prepend($terms+', ');
                }
				$.cookie('geoDelivery', $('.product-delivery_info').html(), {expires: 365, path: '/'});
				if(url.indexOf('ipolh.com') != -1 && url.indexOf('type=self') != -1){
					checkExternalMap(url.replace('calculate.php', 'get_points_v2.php'), id, country, region, city);
				}
			}
		},
		error: function(e){
			$('.js-geo-item-'+id).hide();
		}
	});
}

function checkExternalMap(url, id, country, region, city){
	$.ajax({
		type: 'GET',
		url: url,
		data: 'region='+region+'&city='+city+'&country='+country+'&weight='+geoTotalWeight+'&price='+geoItemsPrice,
		dataType: 'json',
        crossDomain: true,
		success: function(e){
			/*$('.js-geo-item-map').remove();
			$('.js-geo-item-'+id+' .js-geo-title', $('.geo-table')).append('<p class="js-geo-item-map"><a href="#" class="button button-bordered winbox" data-window="geoMap"><i class="fa fa-map-o" aria-hidden="true"></i>&nbsp;&nbsp;  </a></p>');
			$('.js-geo-item-'+id, $('.geo-mini-table')).append('<p class="geo-mini-table-item-map js-geo-item-map"><a href="#" class="link-bold winbox" data-window="geoMap">  </a></p>');*/
			var i = 0;
			geoPvzCoord = [];
			geoPvzCoord.length = 0;
			$.each(e.points, function(index, item){
				geoPvzCoord[i] = {'coordX':item.lat,'coordY':item.lng,'header':item.address,'body':' : '+item.timetable+'<br/>: '+item.phone,'name':item.name};
				i++;
			});
			if(geoPvzCoord.length > 0){
				checkGeoMap();
			}
			$.each(e.providers, function(index, item){
				var item_deliveryCost = 99999;
				$.each(item.tariffs, function(index, item_t){
					if(item_deliveryCost > item_t.deliveryCost){
						item_deliveryCost = item_t.deliveryCost;
					}
				})
				$days = item.days.toString();
				$term = $days.replace(/[^-0-9]/gim,'');
				$item = $term.split('-');
				if($item.length > 0){
					$('.js-geo-item-'+id).html('').html(Shop.money.format(item_deliveryCost));
					$('.js-geo-item-'+id).prepend($term+' '+declOfNum($item[$item.length-1],[" "," "," "])+', ');
				}
			});
		},
		error: function(e){
			//
		}
	});
}

function checkGeoMap(){
	//$('.window-obj-geoMap .window-title').html('<span class="geo-city-short"> : <span>'+geoPvzCity+'</span></span><a href="'+geoDeliveryPageUrl+'" class="button button-bordered winbox" data-window="geo|geoTerm">  </a>');
	$('.js-geo-map').html('<div class="row"><div class="cell-xl-3"><div class="js-geo-pvz-list geo-pvz-list hidden-sm hidden-xs"></div></div><div class="cell-xl-9"><div id="yaGeoMap" style="width: 100%; height: 500px;"></div></div></div>');
	ymaps.ready(init);
	var myMap, myPlacemark;
	geoPvzItems = new Array();
	geoPvzItems = [];
	function init(){
		myMap = new ymaps.Map('yaGeoMap', {
			center: [geoPvzCoord[0].coordX,geoPvzCoord[0].coordY],
			zoom: 10,
			controls: ['zoomControl', 'searchControl', 'typeSelector',  'geolocationControl']
		});
		myMap.behaviors.disable('scrollZoom');
		$.each(geoPvzCoord,function(index, item){
			var activeOptions, defaultOptions;
			activeOptions = {
				preset: 'islands#blueDotIcon',
				balloonPanelMaxMapArea: 'Infinity'
			};
			defaultOptions = {
				preset: 'islands#blackDotIcon',
				balloonPanelMaxMapArea: 'Infinity'
			};
			geoPvzItems[index] = new ymaps.Placemark([item.coordX,item.coordY], {
				balloonContentHeader: item.header,
				balloonContentBody: item.body,
				hintContent: item.header,
				defaultOptions: defaultOptions,
				activeOptions: activeOptions
			}, defaultOptions);
			myMap.geoObjects.add(geoPvzItems[index]);
			$('.js-geo-pvz-list').append('<p class="geo-pvz-list-item"><a href="#" class="js-pvz-list-item-toggle" data-index="'+index+'">'+item.name+'</a></p>')
			//$('.js-geo-pvz-select select').append('<option>'+item.name+'</option>')
		});
		myMap.geoObjects.events.add('balloonopen', function(e){
			var activeGeoObject = e.get('target');
			activeGeoObject.options.set(activeGeoObject.properties.get('activeOptions'));
			myMap.geoObjects.each(function(geoObject){
				if(geoObject !== activeGeoObject){
					geoObject.options.set(geoObject.properties.get('defaultOptions'));
				}
			});
		});
		myMap.geoObjects.events.add('balloonclose', function(e){
			var activeGeoObject = e.get('target');
			activeGeoObject.options.set(activeGeoObject.properties.get('defaultOptions'));
		});
	}
}

